import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [images, setImages] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchImages = async () => {
      try {
        const response = await axios.get('http://localhost:8085/api/v1/employee/images');
        setImages(response.data);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching images:', error);
        setLoading(false);
      }
    };

    fetchImages();
  }, []);

  return (
    <div className="App">
      <h1>Employee Images</h1>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div>
          {images.map((image, index) => (
            <div key={index}>
              <h2>Service: {image.repositoryName}</h2>
              <div>
                {image.map((item, idx) => (
                  <div key={idx} className="image-card">
                    <p>Tag: {item.imageTag}</p>
                    <p>Repository: {item.repositoryName}</p>
                    <p>Pushed At: {item.imagePushedAt}</p>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default App;
